import React from 'react';

const Home = () => {
    return (
        <div className="home-container">
            <h1>Вітання на нашому сайті!</h1>
            <p>Це основна інформація про сайт, де ви знайдете все про автомобілі.</p>
            <button className="button">Дізнатися більше</button>
        </div>
    );
};

export default Home;
